async fn convert_text_to_speech(text: String) -> String {
    // Set the api endpoint and api key
    let endpoint = "https://api.elevenlabs.io/v1/text-to-speech";
    let api_key = "YOUR_API_KEY_HERE";

    // Set the request headers
    let headers = [
        ("Authorization", format!("Bearer {}", api_key)),
        ("Content-Type", "application/json"),
    ];

    // Set the request body
    let body = format!("{{\"text\":\"{}\"}}", text);

    // Send the request
    let response = reqwest::Client::new()
        .post(endpoint)
        .headers(headers)
        .body(body)
        .send()
        .await
        .unwrap();

    // Get the response json
    let json: Value = response.json().await.unwrap();

    // Get the audio url
    let audio_url = json["audio_url"].as_str().unwrap().to_string();

    // Return the audio url
    audio_url
}

async fn play_audio(sink: &Sink, audio_url: String) {
    // Create a buffer
    let buffer = Buffer::new();

    // Create a buffer sink
    let buffer_sink = BufferSink::new(buffer);

    // Add the audio to the buffer sink
    buffer_sink.append(Decoder::new(BufReader::new(Cursor::new(
        reqwest::get(audio_url).await.unwrap().bytes().await.unwrap(),
    ))).unwrap());

    // Play the audio
    sink.append(buffer_sink);
}
